import '../footer/footer.css'

export default class footer extends Component {
  render() {
    return (
        <>
        <div className='body'>
            <div className='box1'>
                <h1>About</h1>
                <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Magnam exercitationem molestiae delectus totam quod, reiciendis, numquam, voluptatum saepe minus quia accusantium unde aliquam pariatur provident adipisci sunt laborum odit nesciunt!</p>
            </div>
            <div className='box2'></div>
            <div className='box3'></div>
        </div>
        </>
    )
  }
}
